import React, { useState } from 'react';

import BootstrapTable from 'react-bootstrap-table-next';
import ToolkitProvider, { Search } from 'react-bootstrap-table2-toolkit';

const { SearchBar } = Search;

const products = [
      {
        id: 1,
        name: 'TV',
        'price': 1000
      },
      {
        id: 2,
        name: 'Mobile',
        'price': 500
      },
      {
        id: 3,
        name: 'Book',
        'price': 20
      },
    ]

const columns = [{
  dataField: 'id',
  text: 'Product ID',
    sort: true
}, {
  dataField: 'name',
  text: 'Product Name',
    sort: true
}, {
  dataField: 'price',
  text: 'Product Price'
}]

const defaultSorted = [{
  dataField: 'name',
  order: 'desc'
}];

const SearchTable= () => (

  <BootstrapTable
    bootstrap4
    keyField="id"
    data={ products }
    columns={ columns }
    defaultSorted={ defaultSorted }
    striped
    hover
  />

);
  export default SearchTable;
